--
-- Definition of trigger `catransactiontbl`
--

DROP TRIGGER IF EXISTS `catransactiontbl`;

DELIMITER $$

CREATE DEFINER = `root`@`localhost` TRIGGER `updateCAdetails` AFTER INSERT ON `catransactiontbl` FOR EACH ROW BEGIN
if new.deposit >0 then 
update cadetailtbl  set AvailBalance = AvailBalance + new.Deposit where CAccountNo=New.CAccountNo;
ELSE
update cadetailtbl set AvailBalance = AvailBalance - New.Withdraw where CAccountNo=New.CAccountNo;
end if ;
IF New.BDeposit > 0 THEN
update cadetailtbl set BookBalance = BookBalance + New.BDeposit where CAccountNo=New.CAccountNo;
ELSE
update cadetailtbl set BookBalance = BookBalance - New.BWithdraw where CAccountNo=New.CAccountNo;
END IF;
END $$

DELIMITER ;

