--
-- Definition of trigger `fasvouchersubtbl`
--

DROP TRIGGER IF EXISTS `fasvouchersubtbl`;

DELIMITER $$

CREATE DEFINER = `root`@`localhost` TRIGGER `UpdateProfitLoss` AFTER INSERT ON `fasvouchersubtbl` FOR EACH ROW BEGIN
if  (select G.Nature  FROM FASGroupTbl G, FASLedgerTbl L WHERE L.LedgerNo=New.LedgerNo and L.GroupNo=G.GroupNo) = 'I' then
if New.Credit>0 then
update FASLedgerTbl set CurrentBalance = CurrentBalance + New.Credit WHERE LedgerNo ='2';
else
update FASLedgerTbl set CurrentBalance = CurrentBalance + New.Debit WHERE LedgerNo ='2';
end if;
else 
if  (select G.Nature  FROM FASGroupTbl G, FASLedgerTbl L WHERE L.LedgerNo=New.LedgerNo and L.GroupNo=G.GroupNo) = 'E' then
if New.Credit>0 then
update FASLedgerTbl set CurrentBalance = CurrentBalance - New.Credit WHERE LedgerNo ='2';
else
update FASLedgerTbl set CurrentBalance = CurrentBalance - New.Debit WHERE LedgerNo ='2';
end if;
end if;
end if;
END $$

DELIMITER ;

