--
-- Definition of trigger `membertransaction`
--

DROP TRIGGER IF EXISTS `membertransaction`;

DELIMITER $$

CREATE DEFINER = `root`@`localhost` TRIGGER `UpdateMemberTbl` AFTER INSERT ON `membertransaction` FOR EACH ROW BEGIN
If new.Deposit > 0 Then
Update membertbl set CallsInArrier=CallsInArrier-new.Deposit where MemberNo=new.AccountNo;
END IF;
END $$

DELIMITER ;

