--
-- Definition of trigger `odtransactiontbl`
--

DROP TRIGGER IF EXISTS `odtransactiontbl`;

DELIMITER $$

CREATE DEFINER = `root`@`localhost` TRIGGER `UpdateODDetail` AFTER INSERT ON `odtransactiontbl` FOR EACH ROW BEGIN
IF new.deposit >0 THEN
update oddetailstbl set Balance=Balance-new.Deposit where AccountNo=new.AccountNo;
ELSE
update oddetailstbl set Balance=Balance+new.Withdraw where AccountNo=new.AccountNo;
END IF;
END $$

DELIMITER ;

